import React from "react";


 const Weather = (props) => {
            return (
                <div className='infoWeath'>
                {!props.info.error &&
            <div>
                <p>Location: {props.info.city} {this.props.info.country}</p>
                <p>Temp: {this.props.info.temp}</p>
                <p>Pressure: {this.props.info.pressure}</p>
                <p>Sunset: { new Date( this.props.info.sunset * 1000).toTimeString()}</p>
            </div>
        }
        <p>{this.props.info.error}</p>
            </div>
            );
};

export default Weather;
